import React from 'react'
import stack_overflow_icon from '../stack_overflow_icon.png'
import { MdMenu } from 'react-icons/md';
import { FaUserCircle } from 'react-icons/fa';
import { FaSearch } from 'react-icons/fa';
import { Link } from 'react-router-dom';
import AskQuestion from './AskQuestionBar';


export default function Welcome() {
  return (
    <div>

    <div className='bg-stone-800 flex items-center justify-between'>

      <div className='flex items-center w-full px-2'>
      <MdMenu size={30} className='text-white'/>
      <img src={stack_overflow_icon} alt="StackOverflow Icon" width={50}/>
      <FaSearch size={20} className='hidden sm:block text-white relative left-6'/>
      <input type="text" className='hidden sm:block w-2/3 rounded-sm px-8 bg-stone-700 text-white' placeholder='Paste here :)'/>
      {/* sidebar */}
      </div>

      {/* // talk with people on twitter about 
      // internship at microsoft and lfx mentorship */}

      <div className='flex items-center px-2 gap-4'>
      <FaSearch size={30} className='sm:hidden text-white'/>
      <FaUserCircle size={35} className='text-white'/>

      </div>
      <AskQuestion />
    </div>
      </div>
  )
}
